import React from 'react'
import { FaInstagram } from "react-icons/fa";
import { FaFacebook } from "react-icons/fa";
import { FaTwitter } from "react-icons/fa";

export default function Footer() {
  return (
    <footer>
    <h2>All ruts are protected</h2>
    <div>
        <a href="https://www.facebook.com/yourpage" target="_blank" img src="facebook-icon.png" alt="Facebook"><FaFacebook /></a>
        <a href="https://www.twitter.com/yourpage" target="_blank" img src="twitter-icon.png" alt="Twitter"><FaTwitter /></a>
        <a href="https://www.instagram.com/yourpage" target="_blank" img src="instagram-icon.png" alt="Instagram"><FaInstagram /></a>
        </div>
    </footer>
  )
}
